    15% checked on Schedule H1 is correct for 2011. There is NO presidential or senatorial
    election that year. (4) Individual disbursements changed to reflect 85% federal
    portion for \"Lincoln-Reagan Day Dinner 2/27/2011\". (5) Payments to individuls
